const bannerText = '<p>This website uses cookies to improve your browsing experience and store relevant information. Before continuing to use our website, please view and accept our <a href=\'#\'>Cookie Policy.</a>'

const addStyle = () => {
  // Replace with link to local css file to change
  /*
    var styleLink = document.createElement('link');
    styleLink.setAttribute("rel", "stylesheet");
    styleLink.setAttribute("type", "text/css");
    styleLink.setAttribute("href", "stylesheet.css");
    */
  // or

  /*
    document.getElementById('cookiePopup').href='stylesheet.css';
  */

  const styleSheet = document.createElement('style')
  styleSheet.innerText = styles
  document.head.appendChild(styleSheet)
}

const addBanner = () => {
  // console.log('Adding banner...')
  const div = document.createElement('div')
  div.setAttribute('id', 'cookiePopup')
  div.classList.add('fade')

  const img = document.createElement('img')

  // Replace with link to local png file to change
  // img.src = 'banner/cookie.png'

  img.src = cookieImgSrc

  const button = document.createElement('button')
  button.setAttribute('acceptCookie', 'cookiePopup')
  button.setAttribute('id', 'acceptCookie')
  button.innerText = button.textContent = 'OK'

  const textDiv = document.createElement('div')
  textDiv.innerHTML = bannerText

  div.appendChild(img)
  div.appendChild(textDiv)
  div.appendChild(button)
  document.body.appendChild(div)
}

// When user clicks the accept button
const acceptCookie = () => {
  const popUp = document.getElementById('cookiePopup')

  document.getElementById('acceptCookie').addEventListener('click', () => {
    setCookie('CookieAccept2', 'Accept', 1)
    // Create date object
    const d = new Date()
    // Increment the current time by 1 minute (cookie will expire after 1 minute)
    d.setMinutes(2 + d.getMinutes())
    // Create Cookie withname = myCookieName, value = thisIsMyCookie and expiry time=1 minute
    document.cookie = 'CookieAccept=Accepted; expires = ' + d + ';'
    // Hide the popup
    popUp.classList.add('hide')
    popUp.classList.remove('show')
  })
}

// Check if cookie is already present
const checkCookie = () => {
  const popUp = document.getElementById('cookiePopup')
  // Read the cookie and split on "="
  const input = document.cookie.split('=')
  // Check for our cookie
  if (input[0] === 'CookieAccept') {
    // Hide the popup
    popUp.style.opacity = 0
    setTimeout(() => {
      popUp.classList.add('hide')
      popUp.classList.remove('show')
    }, 1000)
  } else {
    // Show the popup
    popUp.style.opacity = 1
    setTimeout(() => {
      popUp.classList.add('show')
      popUp.classList.remove('hide')
    }, 1000)
  }
}

